const t={"Виготовлення металоконструкцій Київ":{t:0,b:{t:2,i:[{t:3}],s:"Изготовление металлоконструкций Киев"}},"О компанії":{t:0,b:{t:2,i:[{t:3}],s:"О компании"}},Послуги:{t:0,b:{t:2,i:[{t:3}],s:"Услуги"}},Виробництво:{t:0,b:{t:2,i:[{t:3}],s:"Производство"}},Проектування:{t:0,b:{t:2,i:[{t:3}],s:"Проектирование"}},Київ:{t:0,b:{t:2,i:[{t:3}],s:"Киев"}},"Від 1 тижня":{t:0,b:{t:2,i:[{t:3}],s:"От 1 недели"}},"Від 5000 грн":{t:0,b:{t:2,i:[{t:3}],s:"От 5000 грн"}},"Гарантія від 5 років":{t:0,b:{t:2,i:[{t:3}],s:"Гарантия от 5 лет"}},"За договором":{t:0,b:{t:2,i:[{t:3}],s:"По договору"}},"ВИГОТОВИМ БУДЬ-ЯКУ КОНСТРУКЦІЮ З МЕТАЛУ":{t:0,b:{t:2,i:[{t:3}],s:"ИЗГОТОВИМ ЛЮБУЮ КОНСТРУКЦИЮ ИЗ МЕТАЛЛА"}},"Для приватних будинків, котеджних містечок, комерційних підприємств":{t:0,b:{t:2,i:[{t:3}],s:"Для частных домов, коттеджных городков, коммерческих предприятий"}},"Отримати консультацію":{t:0,b:{t:2,i:[{t:3}],s:"Получить консультацию"}},about1:{t:0,b:{t:2,i:[{t:3}],s:"Компания «ТБК-1» была основана в 2006г."}},about2:{t:0,b:{t:2,i:[{t:3}],s:"Выполняем работы любой сложности, связанные с металлоконструкциями для объектов жилищного строительства, частного сектора, коттеджных городков, бизнеса и производственных предприятий."}},about3:{t:0,b:{t:2,i:[{t:3}],s:"Проектируем, изготавливаем, привозим, монтируем."}},about4:{t:0,b:{t:2,i:[{t:3}],s:"Сотрудничаем со строительными копаниями, подрядными организациями и конечным потребителем."}},МАТЕРІАЛИ:{t:0,b:{t:2,i:[{t:3}],s:"МАТЕРИАЛЫ"}},"У роботі використовуємо тільки перевірені і якісні матеріали. Перевірені роками постачальники забезпечують максимально швидке постачання.":{t:0,b:{t:2,i:[{t:3}],s:"В работе используем только проверенные и качественные материалы. Проверенные годами поставщики обеспечивают максимально быструю поставку."}},ПРОЦЕС:{t:0,b:{t:2,i:[{t:3}],s:"ПРОЦЕСС"}},"Маємо власне виробництво: від різання і складання, до доставки та монтажу. Ми повністю керуємо всіма процесами, даємо гарантію і особисто відповідаємо за якість своїх робіт.":{t:0,b:{t:2,i:[{t:3}],s:"Имеем собственное производство: от резки и сборки, до доставки и монтажа. Мы полностью управляем всеми процессами, даем гарантию и лично отвечаем за качество своих работ."}},"18 РОКІВ НА РИНКУ":{t:0,b:{t:2,i:[{t:3}],s:"18 ЛЕТ НА РЫНКЕ"}},"Ми створюємо металоконструкції з 2006 р. За цей час ми намагалися зарекомендувати себе тільки з хорошого боку і завжди знаходити підхід до клієнта.":{t:0,b:{t:2,i:[{t:3}],s:"Мы создаем металлоконструкции с 2006 г. За это время мы старались зарекомендовать себя только с хорошей стороны и всегда находить подход к клиенту."}},"500+ ОБ'ЄКТІВ":{t:0,b:{t:2,i:[{t:3}],s:"500+ ОБЪЕКТОВ"}},"Наші вироби з металу радують око не тільки в приватних будинках, а й на літніх майданчики, комерційних підприємствах, виробничих приміщеннях та багатоквартирних будинках.":{t:0,b:{t:2,i:[{t:3}],s:"Наши изделия из металла радуют глаз не только в частных домах, но и на летних площадки, коммерческих предприятиях, производственных помещениях и многоквартирных домах."}},"Замовити дзвінок":{t:0,b:{t:2,i:[{t:3}],s:"Заказать звонок"}},"Приклади робіт":{t:0,b:{t:2,i:[{t:3}],s:"Примеры работ"}},"Ми пишаємося кожним виконаним проєктом і завжди орієнтуємось на результат, який перевершує очікування наших клієнтів.":{t:0,b:{t:2,i:[{t:3}],s:"Мы гордимся каждым выполненным проектом и всегда ориентируемся на результат, который превосходит ожидания наших клиентов."}},"Кожна деталь, кожний аспект роботи – це свідчення нашого прагнення до досконалості.":{t:0,b:{t:2,i:[{t:3}],s:"Каждая деталь, каждый аспект работы - это свидетельство нашего стремления к совершенству."}},"Що ми робимо?":{t:0,b:{t:2,i:[{t:3}],s:"Что мы делаем?"}},"Скляні, вентильовані фасади":{t:0,b:{t:2,i:[{t:3}],s:"Стеклянные, вентилируемые фасады"}},facades_desc:{t:0,b:{t:2,i:[{t:3}],s:"Современные фасады, совершенствуют эстетический вид и функциональность любого здания. Наши специалисты обеспечивают точное проектирование, изготовление и монтаж фасадов, используя высококачественные материалы и передовые технологии. Стеклянные фасады гарантируют максимальное естественное освещение и создают уютную среду внутри помещений, а вентилируемые фасады обеспечивают эффективную термо- и звукоизоляцию, а также долговечную защиту от внешних воздействий. Обращайтесь к нам для создания надежных и привлекательных фасадов, которые отвечают вашим самым высоким требованиям."}},"Автомобільні навіси":{t:0,b:{t:2,i:[{t:3}],s:"Автомобильные навесы"}},navesi_desc:{t:0,b:{t:2,i:[{t:3}],s:"Автомобильные навесы обеспечивают надежную защиту от атмосферных воздействий и ультрафиолетового излучения, сохраняя ваше транспортное средство в надлежащем состоянии независимо от погодных условий. Обращайтесь к нам для изготовления и установки автомобильных навесов, которые отличаются долговечностью, эстетическим видом и функциональностью."}},"Паркани, огорожі":{t:0,b:{t:2,i:[{t:3}],s:"Заборы, ограждения"}},parkani_desk:{t:0,b:{t:2,i:[{t:3}],s:"Наши специалисты проектируют и устанавливают заборы различных видов, которые обеспечивают надежную защиту вашего имущества. Используем только высококачественные материалы, что гарантирует долговечность и эстетичность ограждений. Обращайтесь к нам для получения надежного решения, которое будет отвечать вашим потребностям и предпочтениям."}},"Сходи, майданчики":{t:0,b:{t:2,i:[{t:3}],s:"Лестницы, площадки"}},shodi_desc:{t:0,b:{t:2,i:[{t:3}],s:"Мы предоставляем профессиональные услуги по созданию лестниц для любых помещений. Наши специалисты тщательно разрабатывают проект, учитывая все требования заказчика и особенности интерьера. Используем качественные материалы и новейшие технологии, чтобы обеспечить долговечность, надежность и эстетичный вид лестницы. Обращайтесь к нам для создания стильных и функциональных лестниц, которые станут украшением вашего дома или офиса."}},"Розсувні ворота":{t:0,b:{t:2,i:[{t:3}],s:"Раздвижные ворота"}},vorota_desc:{t:0,b:{t:2,i:[{t:3}],s:"Наши специалисты проектируют и устанавливают распашные ворота, сочетающие современный дизайн и высокую функциональность. Используем только качественные материалы, что обеспечивает надежную работу ворот в течение длительного времени. Раздвижные ворота - это идеальное решение для оптимизации пространства и обеспечения удобного доступа к вашей территории. Обращайтесь к нам для получения индивидуального решения, которое будет отвечать вашим потребностям."}},"Двері, хвіртки":{t:0,b:{t:2,i:[{t:3}],s:"Двери, калитки"}},dveri_desc:{t:0,b:{t:2,i:[{t:3}],s:"Мы предлагаем услуги по созданию входных дверей и калиток для вашей безопасности и комфорта. Наши специалисты разрабатывают и устанавливают входные двери и калитки, сочетающие эстетику, прочность и надежность. Используем только высококачественные материалы, которые обеспечивают долговечность и защиту вашего дома или территории. Обратитесь к нам для создания индивидуального решения, которое будет отвечать всем вашим потребностям и предпочтениям."}},"Спроектувати нестандартну металеву конструкцію":{t:0,b:{t:2,i:[{t:3}],s:"Спроектировать нестандартную металлическую конструкцию"}},"* Надайте швидкий опис необхідної металевої конструкції":{t:0,b:{t:2,i:[{t:3}],s:"* Предоставьте быстрое описание необходимой металлической конструкции"}},Розрахувати:{t:0,b:{t:2,i:[{t:3}],s:"Рассчитать"}},"Зварювальні роботи":{t:0,b:{t:2,i:[{t:3}],s:"Сварочные работы"}},"Будь-які види зварювання":{t:0,b:{t:2,i:[{t:3}],s:"Любые виды сварки"}},"від дрібних ремонтних завдань до великих будівельних об'єктів.":{t:0,b:{t:2,i:[{t:3}],s:"от мелких ремонтных задач до крупных строительных объектов."}},"точність і безпека на кожному етапі.":{t:0,b:{t:2,i:[{t:3}],s:"точность и безопасность на каждом этапе."}},"Досвідчені майстри":{t:0,b:{t:2,i:[{t:3}],s:"Опытные мастера"}},"Порошкове фарбування":{t:0,b:{t:2,i:[{t:3}],s:"Порошковая покраска"}},"Ідеально рівне покриття":{t:0,b:{t:2,i:[{t:3}],s:"Идеально ровное покрытие"}},"без підтекань та дефектів.":{t:0,b:{t:2,i:[{t:3}],s:"без подтеков и дефектов."}},"Захист від корозії":{t:0,b:{t:2,i:[{t:3}],s:"Защита от коррозии"}},"ваш метал служитиме довгі роки.":{t:0,b:{t:2,i:[{t:3}],s:"ваш металл будет служить долгие годы."}},"Яскраві та стійкі кольори":{t:0,b:{t:2,i:[{t:3}],s:"Яркие и устойчивые цвета"}},"вибір відтінків для будь-якого стилю.":{t:0,b:{t:2,i:[{t:3}],s:"выбор оттенков для любого стиля."}},"Висока стійкість":{t:0,b:{t:2,i:[{t:3}],s:"Высокая устойчивость"}},"до ударів, подряпин і хімічних впливів.":{t:0,b:{t:2,i:[{t:3}],s:"к ударам, царапинам и химическим воздействиям."}},"Гаряче цинкування":{t:0,b:{t:2,i:[{t:3}],s:"Горячее цинкование"}},"Довговічний захист від корозії":{t:0,b:{t:2,i:[{t:3}],s:"Долговечная защита от коррозии "}},"термін служби оцинкованого металу до 50 років.":{t:0,b:{t:2,i:[{t:3}],s:"срок службы оцинкованного металла до 50 лет."}},"Надійність у будь-яких умовах":{t:0,b:{t:2,i:[{t:3}],s:"Надежность в любых условиях"}},"стійкість до вологи, хімічних впливів і перепадів температур.":{t:0,b:{t:2,i:[{t:3}],s:"устойчивость к влаге, химическим воздействиям и перепадам температур."}},"Економія на ремонтах":{t:0,b:{t:2,i:[{t:3}],s:"Экономия на ремонтах"}},"цинкове покриття знижує витрати на обслуговування.":{t:0,b:{t:2,i:[{t:3}],s:"цинковое покрытие снижает затраты на обслуживание."}},"Згинання металу":{t:0,b:{t:2,i:[{t:3}],s:"Гибка металла"}},"Висока точність":{t:0,b:{t:2,i:[{t:3}],s:"Высокая точность"}},"ідеальна геометрія навіть для найскладніших деталей.":{t:0,b:{t:2,i:[{t:3}],s:"идеальная геометрия даже для самых сложных деталей."}},"Будь-які види металу":{t:0,b:{t:2,i:[{t:3}],s:"Любые виды металла"}},"працюємо з нержавійкою, алюмінієм, сталлю та іншими матеріалами.":{t:0,b:{t:2,i:[{t:3}],s:"работаем с нержавейкой, алюминием, сталью и другими материалами."}},"Сучасне обладнання":{t:0,b:{t:2,i:[{t:3}],s:"Современное оборудование"}},"високотехнологічні верстати для швидкого та якісного результату.":{t:0,b:{t:2,i:[{t:3}],s:"высокотехнологичные станки для быстрого и качественного результата."}},"Обрати послугу":{t:0,b:{t:2,i:[{t:3}],s:"Выбрать услугу"}},"Нам довіряють":{t:0,b:{t:2,i:[{t:3}],s:"Нам доверяют"}},Співпраця:{t:0,b:{t:2,i:[{t:3}],s:"Сотрудничество"}},етап:{t:0,b:{t:2,i:[{t:3}],s:"этап"}},ЗАЯВКА:{t:0,b:{t:2,i:[{t:3}],s:"ЗАЯВКА"}},"Ви можете залишити заявку через сайт, або зателефонувати за телефоном, вказаним у розділі «Контакти».":{t:0,b:{t:2,i:[{t:3}],s:"Вы можете оставить заявку через сайт, или позвонить по телефону, указанному в разделе «Контакты»."}},"ПОПЕРЕДНІЙ РОЗРАХУНОК":{t:0,b:{t:2,i:[{t:3}],s:"ПРЕДВАРИТЕЛЬНЫЙ РАСЧЁТ"}},"Наші експерти проведуть аналіз поданої інформації та нададуть попередню оцінку вартості та термінів виконання робіт. Звертайтесь до нас для отримання професійного й швидкого розрахунку.":{t:0,b:{t:2,i:[{t:3}],s:"Наши эксперты проведут анализ представленной информации и предоставят предварительную оценку стоимости и сроков выполнения работ. Обращайтесь к нам для получения профессионального и быстрого расчета."}},ЗАМІРИ:{t:0,b:{t:2,i:[{t:3}],s:"ЗАМЕРЫ"}},"Ми проведемо всі необхідні вимірювання на місці та надамо детальний звіт. Зверніться до нас для точних і надійних замірів, які стануть основою вашого успішного проєкту.":{t:0,b:{t:2,i:[{t:3}],s:"Мы проведем все необходимые измерения на месте и предоставим подробный отчет. Обратитесь к нам для точных и надежных замеров, которые станут основой вашего успешного проекта."}},ПРОЕКТУВАННЯ:{t:0,b:{t:2,i:[{t:3}],s:"ПРОЕКТИРОВАНИЕ"}},"За необхідністю виконаємо попередне проектування для більш складних металоконструкцій. Наші фахівці працюють над кожним проєктом з уважністю до деталей і врахуванням всіх ваших побажань. Забезпечуємо якісні інженерні рішення, що відповідають сучасним стандартам.":{t:0,b:{t:2,i:[{t:3}],s:"При необходимости выполним предварительное проектирование для более сложных металлоконструкций. Наши специалисты работают над каждым проектом с внимательностью к деталям и учетом всех ваших пожеланий. Обеспечиваем качественные инженерные решения, соответствующие современным стандартам."}},ПОГОДЖЕННЯ:{t:0,b:{t:2,i:[{t:3}],s:"СОГЛАСОВАНИЕ"}},"Ми плідно співпрацюємо з замовником для забезпечення відповідності всіх деталей проєкту вашим вимогам. Проводиться ретельний аналіз і перевірка кожного етапу, обговорюються можливі корективи та пропозиції для оптимального результату. Тільки після вашого підтвердження ми переходимо до наступних етапів реалізації, гарантувавши повну прозорість та відповідність всіх робіт вашим очікуванням.":{t:0,b:{t:2,i:[{t:3}],s:"Мы плодотворно сотрудничаем с заказчиком для обеспечения соответствия всех деталей проекта вашим требованиям. Проводится тщательный анализ и проверка каждого этапа, обсуждаются возможные коррективы и предложения для оптимального результата. Только после вашего подтверждения мы переходим к следующим этапам реализации, гарантировав полную прозрачность и соответствие всех работ вашим ожиданиям."}},ВИКОНАННЯ:{t:0,b:{t:2,i:[{t:3}],s:"ИСПОЛНЕНИЕ"}},"На етапі виконання робіт наші майстри реалізують узгоджений проект відповідно до затвердженого плану. Усі роботи виконуються з дотриманням встановлених стандартів якості та безпеки. Регулярний контроль та корегування процесів забезпечують найкращий результат. Ми інформуємо вас про хід робіт на кожному етапі, забезпечуючи повну прозорість та своєчасне завершення вашого проекту.":{t:0,b:{t:2,i:[{t:3}],s:"На этапе выполнения работ наши мастера реализуют согласованный проект в соответствии с утвержденным планом. Все работы выполняются с соблюдением установленных стандартов качества и безопасности. Регулярный контроль и корректировка процессов обеспечивают наилучший результат. Мы информируем вас о ходе работ на каждом этапе, обеспечивая полную прозрачность и своевременное завершение вашего проекта."}},"Більш ніж 5 років ми виробляємо ті самі конструкції з металу, які всім потрібні":{t:0,b:{t:2,i:[{t:3}],s:"Более 5 лет мы производим те самые конструкции из металла, которые всем нужны"}},"Залишити заявку":{t:0,b:{t:2,i:[{t:3}],s:"Оставить заявку"}},"Усі права захищені © 2016-2022 ТОВ «ТБК-1» - виготовлення мтеалоконструкцій на замовлення в Києві":{t:0,b:{t:2,i:[{t:3}],s:"Все права защищены © 2016-2022 ООО «ТБК-1» - изготовление мтеалоконструкций на заказ в Киеве"}},"Розробка та створення сайту - Personal Solutions Ltd":{t:0,b:{t:2,i:[{t:3}],s:"Разработка и создание сайта - Personal Solutions Ltd"}},"УТОЧНИМО ДЕТАЛІ ПРОЄКТУ?":{t:0,b:{t:2,i:[{t:3}],s:"УТОЧНИМ ДЕТАЛИ ПРОЕКТА?"}},"Дайте відповідь на кілька запитань, і отримайте консультацію та розрахунок вартості  того ж дня.":{t:0,b:{t:2,i:[{t:3}],s:"Ответьте на несколько вопросов, и получите консультацию и расчет стоимости в тот же день."}},"Далі..":{t:0,b:{t:2,i:[{t:3}],s:"Далее"}},"Ваш об'єкт:":{t:0,b:{t:2,i:[{t:3}],s:"Ваш объект:"}},"Приватний будинок":{t:0,b:{t:2,i:[{t:3}],s:"Частный дом"}},"Житловий комплекс":{t:0,b:{t:2,i:[{t:3}],s:"Жилой комплекс"}},"Промисловий об'єкт":{t:0,b:{t:2,i:[{t:3}],s:"Промышленный объект"}},"Торгівельні приміщення":{t:0,b:{t:2,i:[{t:3}],s:"Торгівельні приміщення"}},Інше:{t:0,b:{t:2,i:[{t:3}],s:"Другое"}},"Оберіть виріб, який вам потрібно:":{t:0,b:{t:2,i:[{t:3}],s:"Выберите изделие, которое вам нужно:"}},Фасад:{t:0,b:{t:2,i:[{t:3}],s:"Фасад"}},Навіс:{t:0,b:{t:2,i:[{t:3}],s:"Навес"}},Огорожа:{t:0,b:{t:2,i:[{t:3}],s:"Ограждение"}},Сходи:{t:0,b:{t:2,i:[{t:3}],s:"Лестница"}},Ворота:{t:0,b:{t:2,i:[{t:3}],s:"Ворота"}},Хвіртка:{t:0,b:{t:2,i:[{t:3}],s:"Калитка"}},"Заявку надіслано.":{t:0,b:{t:2,i:[{t:3}],s:"Заявка отправлена."}},"Ми зв'яжемось з Вами найближчим часом.":{t:0,b:{t:2,i:[{t:3}],s:"Мы свяжемся с Вами в ближайшее время."}},Закрити:{t:0,b:{t:2,i:[{t:3}],s:"Закрыть"}},"* Оберіть ваш об'єкт":{t:0,b:{t:2,i:[{t:3}],s:"* Выберите ваш объект"}},"* Оберіть виріб, який вам потрібно":{t:0,b:{t:2,i:[{t:3}],s:"* Выберите изделие, которое вам нужно:"}},"* Обов'язково до заповнення":{t:0,b:{t:2,i:[{t:3}],s:"* Обязательно к заполнению"}},"* Не коректний номер телефону":{t:0,b:{t:2,i:[{t:3}],s:"* Не корректный номер телефона"}}};export{t as default};
